        public static 云码ResponseModel 云码Request(string imgBase64)
        {
            try
            {
                var client = new RestClient("https://www.jfbym.com/api/YmServer/customApi");
                var request = new RestRequest();
                request.Method = Method.Post;
                request.AddParameter("token", "fHVfFdCWFwsRDd9l0ZBSpxqd86aWprJopChQ_v46rz8");
                request.AddParameter("image", imgBase64);
                request.AddParameter("type", "30009");
                RestResponse response = (RestResponse)client.Execute(request);
                云码ResponseModel result = JsonConvert.DeserializeObject<云码ResponseModel>(response.Content);
                return result;
            }
            catch (Exception ee)
            {
                return new 云码ResponseModel() { code = 0, msg = "程序异常" };
            }

        }
        /// <summary>
        /// 重复三次
        /// </summary>
        /// <param name="imgBase64"></param>
        /// <param name="count"></param>
        /// <returns></returns>
        public static string GetClickLocal(string imgBase64, int count = 3)
        {
            string result = string.Empty;
            try
            {
                if (count < 0)
                {
                    result = "失败";
                }
                云码ResponseModel res = 云码Request(imgBase64);
                if (res.code == 10000)
                {
                    string local = res.data.data;
                    int x = int.Parse(local.Split(',')[0]);
                    int y = int.Parse(local.Split(',')[1]);
                    return TranseXYToLocal(x, y);
                }
                else
                {
                    Thread.Sleep(1000);
                    count--;
                    return GetClickLocal(imgBase64, count);
                }
            }
            catch (Exception e)
            {
                Thread.Sleep(1000);
                count--;
                return GetClickLocal(imgBase64, count);
            }

        }
